import NewList from "./NewList";
import { FaMinusSquare, FaPlusSquare, FaTrash } from "react-icons/fa";

const List = ({ list, onToggle, toggleList }) => {
  console.log(toggleList);

  let iconStyle = {
    fontSize: "0.75rem",
    paddingRight: "0.25rem",
    cursor: "pointer",
  };
  return (
    <ul type="none">
      {Object.keys(list).length
        ? Object.keys(list).map((key, i) => (
            <>
              <li key={key}>
                {Object.keys(list[key]).length ? (
                  toggleList === key ? (
                    <FaMinusSquare style={iconStyle} onClick={onToggle} />
                  ) : (
                    <FaPlusSquare style={iconStyle} onClick={onToggle} />
                  )
                ) : null}
                {key}{" "}
                <FaTrash
                  style={{
                    cursor: "pointer",
                    float: "right",
                    marginRight: "40rem",
                    fontSize: "0.75rem",
                  }}
                />
              </li>
              <NewList
                list={list[key]}
                onToggle={onToggle}
                toggleList={toggleList}
              />
            </>
          ))
        : ""}
    </ul>
  );
};

export default List;
